import React from 'react';
import classes from './StepEleven.module.css';

import SliderSteps from './SliderSteps/SliderSteps';
const StepEleven = () => {
	return (
		<section className={classes['step-eleven']}>
			<h2>Monitor Progress with your personal setting</h2>
			<p>
				In this sections, you can keep track of tangible changes and outcomes
				that have come about as a result of this process of figuring out how
				hyou can function better. Wheter less stressed, more optimistic, or more
				focused, keeping track of the benefits gained becomes as valuable
				exercise in the process of acieving hearling and well-being. It can be
				like an assessment tool as it enables you to minitor your progress as
				well as bieng to determine patterns and predict trends, behaviors, and
				aoutcomes for yourself.
			</p>
			<p>
				Use the list below of moving the slider from range of 1-10, with 10
				being the best state.
			</p>

			<div className={classes['sliders']}>
				<SliderSteps />
			</div>
		</section>
	);
};

export default StepEleven;
